import React from 'react'
import MainProject from "./pages/MainProjectPage/MainProject";
import DashboardPage from "./pages/DesignPage/DesignPage";
import Construction from "./pages/ConstructionPage/Construction";

const routes = [
    {
        path: '/',
        exact: true,
        main: () => <MainProject/>
    },
    {
        path: '/dashboard',
        exact: true,
        main: () => <DashboardPage/>
    },
    {
        path: '/',
            exact: true,
        main: () => <Construction/>
    }
];

export default routes;
